Campaign.sol.content:
// SPDX-License-Identifier: Unlicensed

pragma solidity >0.7.0 <=0.9.0;

contract CampaignFactory {
    address[] public deployedCampaigns;

    event CampaignCreated(
        string title,
        uint requiredAmount,
        address indexed owner,
        address campaignAddress,
        string imgURI,
        uint indexed timestamp,
        string indexed category
    );

    function createCampaign(
        string memory campaignTitle, 
        uint requiredCampaignAmount, 
        string memory imgURI, 
        string memory category,
        string memory storyURI
    ) public {
        Campaign newCampaign = new Campaign(
            campaignTitle, 
            requiredCampaignAmount, 
            imgURI, 
            storyURI, 
            msg.sender
        );

        deployedCampaigns.push(address(newCampaign));

        emit CampaignCreated(
            campaignTitle, 
            requiredCampaignAmount, 
            msg.sender, 
            address(newCampaign),
            imgURI,
            block.timestamp,
            category
        );
    }

    function getDeployedCampaignsCount() public view returns (uint) {
        return deployedCampaigns.length;
    }

    function getCampaignAddressByIndex(uint index) public view returns (address) {
        require(index < deployedCampaigns.length, "Index out of bounds");
        return deployedCampaigns[index];
    }
}



contract Campaign {
    string public title;
    uint public requiredAmount;
    string public image;
    string public story;
    address payable public owner;
    uint public receivedAmount;

    // event donated(address indexed donar, uint indexed amount, uint indexed timestamp);

    constructor(
        string memory campaignTitle, 
        uint requiredCampaignAmount, 
        string memory imgURI,
        string memory storyURI,
        address campaignOwner
    ) {
        title = campaignTitle;
        requiredAmount = requiredCampaignAmount;
        image = imgURI;
        story = storyURI;
        owner = payable(campaignOwner);
    }

    function donate() public payable {
        require(requiredAmount > receivedAmount, "required amount fullfilled");
        owner.transfer(msg.value);
        receivedAmount += msg.value;
        // emit donated(msg.sender, msg.value, block.timestamp);
    }
}

